import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Header = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [mobileNavOpen, setMobileNavOpen] = useState(false);
  const navigate = useNavigate();

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchQuery.trim()) {
      navigate(`/cars?q=${encodeURIComponent(searchQuery.trim())}`);
      setSearchQuery('');
      setMobileNavOpen(false);
    }
  };

  const toggleMobileNav = () => {
    setMobileNavOpen(!mobileNavOpen);
  };

  return (
    <header className="header">
      <div className="container">
        <div className="header-content">
          <Link to="/" className="brand">
            CarRent<span className="accent">Pro</span>
          </Link>

          <nav className="nav">
            <Link to="/cars">Browse</Link>
            <Link to="/contact">Contact</Link>
            <Link to="/admin">Admin</Link>

            <form className="search-form" onSubmit={handleSearch}>
              <input
                type="text"
                className="search-input"
                placeholder="Search cars..."
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
              />
              <button type="submit" className="search-button">
                Search
              </button>
            </form>
          </nav>

          <div className="burger-menu" onClick={toggleMobileNav}>
            <div className="burger-line"></div>
            <div className="burger-line"></div>
            <div className="burger-line"></div>
          </div>
        </div>

        <nav className={`mobile-nav ${mobileNavOpen ? 'active' : ''}`}>
          <Link to="/cars" onClick={() => setMobileNavOpen(false)}>Browse</Link>
          <Link to="/contact" onClick={() => setMobileNavOpen(false)}>Contact</Link>
          <Link to="/admin" onClick={() => setMobileNavOpen(false)}>Admin</Link>

          <form className="search-form" onSubmit={handleSearch}>
            <input
              type="text"
              className="search-input"
              placeholder="Search cars..."
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
            />
            <button type="submit" className="search-button">
              Search
            </button>
          </form>
        </nav>
      </div>
    </header>
  );
};

export default Header;
